import React from 'react';
import ReactDOM from 'react-dom';
import App from "./components/App";
ReactDOM.render(<App />,document.getElementById("root"))
const twitter=document.getElementById("twitter")
const facebook=document.getElementById("facebook")
const github=document.getElementById("github")
twitter.addEventListener("click",()=>{window.location.href = 'http://www.google.com';})
facebook.addEventListener("click",()=>{window.location.href = 'http://www.google.com';})
github.addEventListener("click",()=>{window.location.href = 'http://www.google.com';})
